import React from "react";
import { Routes, Route, Link } from "react-router-dom";

const DogRunPage: React.FC = () => {
  return <div>
      <h2>全国のドッグランを探す</h2>
      <p>ここにドッグランの詳細情報を表示します</p>
      <Link to = "info" >Info</Link> | <Link to = "Galley">Galley</Link>
    </div>
};

export default DogRunPage;
